--
-- Table structure for table `incidencias`
--

DROP TABLE IF EXISTS `incidencias`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8mb4 */;
CREATE TABLE `incidencias` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_tecnico` int(11) DEFAULT NULL,
  `id_user` int(11) DEFAULT NULL,
  `id_sensor` int(11) DEFAULT NULL,
  `titulo` varchar(255) NOT NULL,
  `descripcion` text DEFAULT NULL,
  `fecha_creacion` timestamp NOT NULL DEFAULT current_timestamp(),
  `fecha_finalizacion` timestamp NULL DEFAULT NULL,
  `estado_id` int(11) DEFAULT 1,
  PRIMARY KEY (`id`),
  KEY `idx_incidencias_usuarios` (`id_tecnico`,`id_user`),
  KEY `fk_incidencias_user` (`id_user`),
  KEY `fk_incidencias_estado` (`estado_id`),
  KEY `idx_incidencias_fecha` (`fecha_creacion`),
  KEY `fk_incidencia_sensor` (`id_sensor`),
